class Solution {
    public int lengthOfLongestSubstring(String s) {
        int max = 0;
        int[] num = new int[1000];
        for (int i = 0; i < s.length(); i++) {
            int n = 0;
            for (int j = 0; j < 999; j++) {
                num[j] = 0;
            }
            for (int j = i; j < s.length(); j++) {
                if (0 == num[(int) s.charAt(j)]) {
                    n += 1;
                    num[(int) s.charAt(j)] = 1;
                } else {
                    break;
                }
            }
            if (n > max) {
                max = n;
            }

        }

        return max;
    }
}